from collections import defaultdict

def generate_sql(data):
    # Menggunakan defaultdict untuk menyimpan total harga per ID
    penjualanbrg_totals = defaultdict(lambda: {'tanggal': '', 'total_harga': 0, 'nama_pelanggan': ''})
    detail_penjualan_values = []

    # Memisahkan data menjadi list baris
    lines = data.strip().splitlines()

    for line in lines:
        # Memisahkan tiap elemen dari baris
        fields = line.split("\t")
        id_penjualanbrg = fields[0]
        tanggal = fields[1]
        kode_barang = fields[2]
        nama_barang = fields[3]
        jumlah = int(fields[4])

        # Menghapus titik dan mengonversi koma menjadi titik desimal, lalu ke integer
        harga_jual = int(float(fields[5].replace(".", "").replace(",", ".")))
        total_harga = int(float(fields[6].replace(".", "").replace(",", ".")))
        nama_pelanggan = fields[7]

        # Menambah total_harga ke penjualanbrg_totals dengan ID yang sama
        if penjualanbrg_totals[id_penjualanbrg]['total_harga'] == 0:
            # Hanya set tanggal dan nama_pelanggan sekali untuk ID yang sama
            penjualanbrg_totals[id_penjualanbrg]['tanggal'] = tanggal
            penjualanbrg_totals[id_penjualanbrg]['nama_pelanggan'] = nama_pelanggan

        penjualanbrg_totals[id_penjualanbrg]['total_harga'] += total_harga

        # Menambahkan ke detail_penjualan untuk setiap baris
        detail_penjualan_values.append(f"({id_penjualanbrg}, '{kode_barang}', {jumlah}, {harga_jual})")

    # Membuat SQL insert untuk penjualanbrg
    insert_penjualanbrg = "INSERT INTO penjualanbrg (id_penjualanbrg, tanggal, total_harga, nama_pelanggan) VALUES\n"
    penjualanbrg_values = [
        f"({id}, '{info['tanggal']}', {info['total_harga']}, '{info['nama_pelanggan']}')"
        for id, info in penjualanbrg_totals.items()
    ]
    insert_penjualanbrg += ",\n".join(penjualanbrg_values) + ";"

    # Membuat SQL insert untuk detail_penjualan
    insert_detail_penjualan = "INSERT INTO detail_penjualan (id_penjualanbrg, kode_barang, jumlah, harga_jual) VALUES\n"
    insert_detail_penjualan += ",\n".join(detail_penjualan_values) + ";"

    return insert_penjualanbrg + "\n\n" + insert_detail_penjualan


